cy.visit('https://example.cypress.io/commands/network-requests');
cy.intercept('GET', '**/comments/*', req => {
  const id = req.url.split('/').pop();
  if (id === '1') {
    req.reply({
      statusCode: 200,
      body: {
        id: 1,
        name: 'QA Bot',
        body: 'First stubbed comment'
      }
    });
  } else if (id === '2') {
    req.reply({
      statusCode: 200,
      body: {
        id: 2,
        name: 'QA Bot',
        body: 'Second stubbed comment'
      }
    });
  } else {
    req.reply({
      statusCode: 200,
      body: {
        id,
        name: 'QA Bot',
        body: 'Fallback stub'
      }
    });
  }
}).as('getComment');
cy.contains('Get Comment').click();
cy.wait('@getComment').its('response.statusCode').should('eq', 200);
cy.get('.network-comment').invoke('text').then(text => {
  const t = text.trim();
  expect(/First stubbed comment|Second stubbed comment|Fallback stub/.test(t), `unexpected text: "${t}"`).to.be.true;
});

cy.visit('https://example.cypress.io/commands/network-requests');
// 1) Upewnij si, e jeste na waciwej stronie
cy.get('h1', {
  timeout: 10000
}).should('contain.text', 'Network Requests');
// 2) Intercept z REGEX-em (apie np. .../comments/1, /comments/123)
cy.intercept({
  method: 'GET',
  url: /\/comments\/\d+$/
}).as('getComment');
// 3) Klik  najpierw przewi i upewnij si, e wida
cy.contains('Get Comment', {
  timeout: 10000
}).scrollIntoView().should('be.visible').click();
// 4) Czekaj na request (duszy timeout na wszelki wypadek) i zaloguj szczegy
cy.wait('@getComment', {
  timeout: 10000
}).then(interception => {
  cy.log('METHOD: ' + interception.request.method);
  cy.log('URL: ' + interception.request.url);
  cy.log('STATUS: ' + interception.response.statusCode);
  expect(interception.response.statusCode).to.equal(200);
});
// 5) UI powinno mie tre komentarza
cy.get('.network-comment', {
  timeout: 10000
}).invoke('text').then(t => expect(t.trim()).to.not.equal(''));

